USE `electionsys`;

/*Table structure for table `candidatos` */

DROP TABLE IF EXISTS `candidatos`;

CREATE TABLE `candidatos` (
  `ideleccion` varchar(10) COLLATE utf8_spanish_ci NOT NULL,
  `idcandidato` varchar(20) COLLATE utf8_spanish_ci NOT NULL,
  `idcurso` varchar(10) COLLATE utf8_spanish_ci NOT NULL,
  `idcurul` varchar(10) COLLATE utf8_spanish_ci NOT NULL,
  `numero_electoral` varchar(10) COLLATE utf8_spanish_ci NOT NULL,
  `foto` longblob NOT NULL,
  `estado` char(1) COLLATE utf8_spanish_ci NOT NULL COMMENT 'A= Activo, I=Inactivo',
  PRIMARY KEY (`ideleccion`,`idcandidato`),
  KEY `FK_candidatos_estudiantes` (`idcandidato`),
  KEY `FK_candidatos_cursos` (`idcurso`),
  KEY `FK_candidatos_curules` (`idcurul`),
  CONSTRAINT `FK_candidatos_curules` FOREIGN KEY (`idcurul`) REFERENCES `curules` (`idcurul`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_candidatos_cursos` FOREIGN KEY (`idcurso`) REFERENCES `cursos` (`idcurso`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_candidatos_elecciones` FOREIGN KEY (`ideleccion`) REFERENCES `elecciones` (`ideleccion`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_candidatos_estudiantes` FOREIGN KEY (`idcandidato`) REFERENCES `estudiantes` (`idestudiante`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

